import Vue from 'vue'
import Router from 'vue-router'
Vue.use(Router)
const router = new Router({
	mode:'history',
	routes:[
		{
			path : '/',
	    	redirect : '/views/index',
		},
		{
	    	path : '/login',
	    	name : 'login',
	    	component : () => import('@/views/login.vue'),
	    	meta: {
		        title: '登陆'
		    }
	    },
	    {
	    	path : '/register',
	    	name : 'register',
	    	component : () => import('@/views/register.vue'),
	    	meta: {
		        title: '注册'
		    }
	    },
	    {
	    	path : '/views',
	    	name : 'views',
	    	component : () => import('@/components/layout.vue'),
	    	children : [{
	    		path : 'index',
	    		name : 'index',
	    		component : () => import('@/views/index.vue'),
	    		meta: {
			        title: '项目总览'
			    }
	    	},
	    	//测试服务
	    	{
	    		path : 'compatible',
	    		name : 'compatible',
	    		component : () => import('@/views/compatible.vue'),
	    		meta: {
	    			parent:['测试服务'],
			        title: '兼容测试'
			    }
	    	},
	    	//测试管理
	    	{
	    		path : 'taskStatus',
	    		name : 'taskStatus',
	    		component : () => import('@/views/taskStatus.vue'),
	    		meta: {
	    			parent:['测试管理'],
			        title: '任务状态'
			    }
	    	},
	    	//管理中心
	    	{
	    		path : 'allManage',
	    		name : 'allManage',
	    		component : () => import('@/views/allManage.vue'),
	    		meta: {
	    			parent:['管理中心'],
			        title: '项目总览'
			    }
	    	},
	    	{
	    		path : 'proManage',
	    		name : 'proManage',
	    		component : () => import('@/views/proManage.vue'),
	    		meta: {
	    			parent:['管理中心'],
			        title: '项目管理'
			    }
	    	},
	    	{
	    		path : 'taskDetail',
	    		name : 'taskDetail',
	    		component : () => import('@/views/taskDetail.vue'),
	    		meta: {
	    			parent:['管理中心','项目管理'],
			        title: '任务详情'
			    }
	    	},
	    	{
	    		path : 'taskEdit',
	    		name : 'taskEdit',
	    		component : () => import('@/views/taskEdit.vue'),
	    		meta: {
	    			parent:['管理中心','项目管理'],
			        title: '任务编辑'
			    }
	    	}]
	    },{
	    	path : '/404',
	    	component : () => import('@/components/common/404.vue')
	    },{
	    	path : '/403',
	    	component : () => import('@/components/common/403.vue')
	    },{
	    	path : '*',
	    	redirect : '/404'
	    }
	]
})
